(function(){"use strict";var e,t;window.onload=function(){if(typeof Storage!=="undefined"){e=document.querySelectorAll("input,textarea");for(var n=e.length-1;n>=0;n--){t=e[n].name;if(sessionStorage[t]!==undefined&&e[n].name!==""){e[n].value=sessionStorage[t]}}document.onkeyup=function(){for(var n=e.length-1;n>=0;n--){t=e[n].name;if(e[n].name!==""){sessionStorage[t]=e[n].value}}}}}})()